import * as React from 'react';

import Beer from './beer';

interface BeerContainer {
    beers: Array<Beer>
};

export default class BeerList extends React.Component {
    beers: Array<Beer> = [];

    constructor(props:string[]) {
        super(props);
        this.beers.push(new Beer("corona"));
        this.beers = Array.from(props).map((s, i) => new Beer(s));
    }

    render () {
        return (
            <div>
                {this.beers.map((b: Beer) => (
                    <li>{b}</li>
                ))}
            </div>
    );
    }
}
